    console.log(card, 'clicked')
  }

  render() {
    return (
      <div className="memory">
        <GuessCount guesses={0} />
        <Card card="Hidden" feedback="hidden" onClick={this.handleCardClick} />
        <Card card="JustMatched" feedback="justMatched" onClick={this.handleCardClick} />
        <Card card="JustMismatched" feedback="justMismatched" onClick={this.handleCardClick} />
        <Card card="visible" feedback="visible" onClick={this.handleCardClick} />
        <Card card="justMatched" feedback="justMatched" onClick={this.handleCardClick} />
      </div>
    )
  }
}


